angular.module('twitterApp.services', []).factory('twitterService', function($q) {

    var authorizationResult = false,
        result = false;

    return {
        initialize: function() {
            OAuth.initialize('T_si0nS9LhgQsCtRaBELZa5h_4Q', {cache:true});
            authorizationResult = OAuth.create('twitter');
        },
        isReady: function() {
            return (authorizationResult);
        },
        Me: function () {

            if ( ! authorizationResult ) {
                return false;
            }

            var deferred = $q.defer();
                
            authorizationResult.me().done(function (response) {
                result = response;
                deferred.resolve();
            });

            return deferred.promise;
        },
        MeId: function () {
            return result;
        },
        connectTwitter: function() {
            var deferred = $q.defer();
            OAuth.popup('twitter', {cache:true}, function(error, result) {
                if ( ! error) {
                    authorizationResult = result;
                    deferred.resolve();
                }
            });
            return deferred.promise;
        },
        clearCache: function() {
            OAuth.clearCache('twitter');
            authorizationResult = false;
        }
    };
    
});
